    for i in range(len(primes) - 3):
        if primes[i + 1] + primes[i] == 2 and primes[i + 2] - primes[i] == 6 and (primes[i + 3] - primes[i] == 8):
            if isPrime(sum(primes[i:i + 4])):
                print(primes[i:i + 4])

